import React from 'react'
import { useSelector } from 'react-redux'

const Users = () => {
  const users = useSelector(state => state.users)
  return (
    <div>
      {users.map(user => user.blogs.flat().map(blog => <li>{blog}</li>))}
    </div>
  )
}

export default Users
